function diffsTmpTest(testDiffs) {
	var buffer, fails = 0, total = 0;
	for (var sVoc in testDiffs) {
		total++;
		var base = testDiffs[sVoc];
		var stem = stemmer(sVoc);
		if (base != stem) {
			fails++;
			if (buffer) {
				buffer += "; ";
				buffer += sVoc + " --> " + base + " | " + stem;
			} else {
				buffer = sVoc + " --> " + base + " | " + stem;
			}
		}
	}
	assertUndefined("Total:" + total + ", fails: " + fails, buffer);
}

